export function PhoneVideo(props) {
	const [ id ] = useState(uuidv4());

	useEffect(() => {
		if (props.color_spot) applyFill('.spot', props.color_spot);
		if (props.color_text) applyFill('.text', props.color_text);
	});

	const applyFill = (class_name, color) => {
		let svg = document.getElementById(id)
		let elems = svg.querySelectorAll(class_name);
		if(!elems) { return; }
		for (let elem of elems) { elem.style.fill = color; }
	}

	return (
		<>
			<div className="clip-cont">
				{Phone(id)}
				<video style={{transform:"translate(" + TRANSLATE_VIDEO + ")"}} height={PHONE_SIZE} className="svg-clip-video" id="video1" loop controls>
					<source src={props.src} type="video/mp4"/>
				</video>
			</div>
		</>
	);
}
